import React from 'react';
import ReactDOM from 'react-dom';
import CommentDetails from './CommentDetails';
import faker from 'faker';
const App= () =>{
    return (<div className="uiContainer">
    <CommentDetails author="Abhinav Singh"timeAgo="Today at 11:00 AM" content="Nice Blog Post!" avatar={faker.image.avatar()}/>
    <CommentDetails author="Avinash Singh"timeAgo="Today at 1:00 AM"content="Good One"avatar={faker.image.avatar()}/>
    <CommentDetails author="Ram Singh"timeAgo="Today at 12:00 AM"content="Superb"avatar={faker.image.avatar()}/>
    </div>
    );
};
ReactDOM.render(<App/>,document.querySelector('#root'));
